const db = require('../models');
const Sequelize = require("sequelize");
const Op = Sequelize.Op;

let ChangPasswordAccount = (data) => {
    return new Promise(async (resolve, reject) => {
        try {
            if (!data.username || !data.password || !data.newPassword) {
                resolve({
                    errCode: 1,
                    errMessage: 'Missing parameter'
                })
            }
            else {

                let isExistAccount = await db.User.findOne({
                    where: { username: data.username }
                })

                if (isExistAccount) {
                    let res = await db.User.update(
                        { password: data.newPassword },
                        {
                            where: {
                                username: isExistAccount.username,
                                password: data.password
                            }

                        })

                    if (res == 1) {
                        resolve({
                            errMessage: 'ok',
                            errCode: 0,
                        })
                    }
                    else {
                        resolve({
                            errMessage: 'Mật khẩu không chính xác',
                            errCode: 2,
                        })
                    }
                } else {
                    resolve({
                        errMessage: 'Lỗi thông tin tài khoản',
                        errCode: 0,
                    })
                }

            }
        } catch (e) {
            reject(e);
        }
    })
}

let ChangeInforAccount = (data) => {
    return new Promise(async (resolve, reject) => {
        try {
            if (!data.id || !data.username || !data.roleId) {
                resolve({
                    errCode: 1,
                    errMessage: 'Missing parameter'
                })
            }
            else {

                await db.User.update(
                    { roleId: data.roleId },
                    {
                        where: {
                            id: data.id,
                            username: data.username
                        }

                    })

                resolve({
                    errMessage: 'ok',
                    errCode: 0,
                })

            }
        } catch (e) {
            reject(e);
        }
    })
}

let ChangeInforGame = (data) => {
    return new Promise(async (resolve, reject) => {
        try {
            if (
                !data.id ||
                !data.name ||
                !data.img ||
                !data.url ||
                !data.contentMarkdown ||
                !data.contentHTML ||
                !data.capacity ||
                !data.partNumber ||
                !data.ram ||
                !data.playerNumber ||
                !data.language ||
                !data.win ||
                !data.playWith ||
                !data.seri ||
                !data.tags
            ) {
                resolve({
                    errCode: 1,
                    errMessage: 'Missing parameter'
                })
            }
            else {

                await db.Game.update(
                    {
                        name: data.name,
                        img: data.img,
                        url: data.url,
                        contentMarkdown: data.contentMarkdown,
                        contentHTML: data.contentHTML,
                        capacity: data.capacity,
                        partNumber: data.partNumber,
                        ram: data.ram,
                        playerNumber: data.playerNumber,
                        language: data.language,
                        win: data.win,
                        language: data.language,
                        playWith: data.playWith,
                        seri: data.seri,
                    },
                    {
                        where: {
                            id: data.id,
                        }

                    })

                let gameId = data.id

                const tag = [];

                await db.Game.destroy({
                    where: {
                        gameId: gameId
                    },
                });

                data.tags.map((item, index) => {
                    tag[index] = {};
                    tag[index].tagId = item
                    tag[index].gameId = gameId
                })

                await db.TagGame.bulkCreate(tag)

                resolve({
                    errMessage: 'ok',
                    errCode: 0,
                })

            }
        } catch (e) {
            reject(e);
        }
    })
}


let CreateNewGame = (data) => {
    return new Promise(async (resolve, reject) => {
        try {
            if (
                !data.name ||
                !data.img ||
                !data.url ||
                !data.contentMarkdown ||
                !data.contentHTML ||
                !data.capacity ||
                !data.partNumber ||
                !data.ram ||
                !data.playerNumber ||
                !data.language ||
                !data.win ||
                !data.playWith ||
                !data.seri ||
                !data.tags
            ) {

                resolve({
                    errCode: 1,
                    errMessage: 'Missing parameter'
                })
            }

            else {

                const jane = await db.Game.create({
                    name: data.name,
                    img: data.img,
                    url: data.url,
                    contentMarkdown: data.contentMarkdown,
                    contentHTML: data.contentHTML,
                    capacity: data.capacity,
                    partNumber: data.partNumber,
                    ram: data.ram,
                    playerNumber: data.playerNumber,
                    language: data.language,
                    win: data.win,
                    language: data.language,
                    playWith: data.playWith,
                    seri: data.seri,
                });

                let gameId = jane.toJSON().id

                const tag = [];

                data.tags.map((item, index) => {
                    tag[index] = {};
                    tag[index].tagId = item
                    tag[index].gameId = gameId
                })

                await db.TagGame.bulkCreate(tag)

                resolve({
                    errCode: 0,
                    message: 'Oke'
                })
            }

        }
        catch (expcept) {
            reject(expcept);
        }
    })
}

let CreateNewAccount = (data) => {
    return new Promise(async (resolve, reject) => {
        try {
            if (
                !data.username ||
                !data.password ||
                !data.roleId
            ) {

                resolve({
                    errCode: 1,
                    errMessage: 'Missing parameter'
                })
            }

            else {

                let account = await db.User.findOne({ where: { username: data.username } });

                if (account) {
                    resolve({
                        errCode: 2,
                        errMessage: 'Tài khoản đã tồn tại'
                    })
                } else {
                    const jane = await db.User.create({
                        username: data.username,
                        password: data.password,
                        roleId: data.roleId
                    });

                    resolve({
                        errCode: 0,
                        message: 'Oke'
                    })
                }


            }

        }
        catch (expcept) {
            reject(expcept);
        }
    })
}

let DeleteAccount = (data) => {
    return new Promise(async (resolve, reject) => {
        try {
            if (
                !data.username
            ) {

                resolve({
                    errCode: 1,
                    errMessage: 'Missing parameter'
                })
            }

            else {

                await db.User.destroy({
                    where: {
                        username: data.username
                    },
                });

                resolve({
                    errCode: 0,
                    message: 'Oke'
                })



            }

        }
        catch (expcept) {
            reject(expcept);
        }
    })
}

let DeleteGame = (data) => {
    return new Promise(async (resolve, reject) => {
        try {
            if (
                !data.id
            ) {

                resolve({
                    errCode: 1,
                    errMessage: 'Missing parameter'
                })
            }

            else {

                await db.Game.destroy({
                    where: {
                        id: data.id
                    },
                });

                resolve({
                    errCode: 0,
                    message: 'Oke'
                })



            }

        }
        catch (expcept) {
            reject(expcept);
        }
    })
}


let getAllTopGame = (limit, type) => {
    return new Promise(async (resolve, reject) => {
        try {
            if (!limit || !type) {
                resolve({
                    errCode: 1,
                    errMessage: 'Missing parameter'
                })
            }
            else {
                let orderByType = [];

                switch (type) {
                    case 'NEW':
                        orderByType = ['updatedAt', 'DESC'];
                        break;

                    case 'HOT':
                        orderByType = ['point', 'DESC'];
                        break;

                    case 'OUTSTANDING':
                        orderByType = ['point', 'DESC'];
                        break;

                    default:
                        orderByType = ['updatedAt', 'DESC'];
                        break;
                }



                let fake = await db.Game.findAll({
                    include: [
                        {
                            model: db.TagGame,
                            include: [
                                { model: db.AllCode }
                            ]
                        }
                    ],
                    limit: +limit,
                    order: [
                        orderByType,
                    ],

                    raw: true,
                    nest: true
                })



                let resultMap = new Map();

                fake.forEach(item => {
                    const id = item.id;

                    if (!resultMap.has(id)) {
                        resultMap.set(id, {
                            id: item.id,
                            name: item.name,
                            img: item.img,
                            url: item.url,
                            contentMarkdown: item.contentMarkdown,
                            contentHTML: item.contentHTML,
                            capacity: item.capacity,
                            partNumber: item.partNumber,
                            ram: item.ram,
                            playerNumber: item.playerNumber,
                            language: item.language,
                            win: item.win,
                            playWith: item.playWith,
                            seri: item.seri,
                            point: item.point,
                            createdAt: item.createdAt,
                            updatedAt: item.updatedAt,
                            TagGames: [item.TagGames],
                        });
                    } else {


                        resultMap.get(id).TagGames.push(item.TagGames);


                    }
                });

                let data = Array.from(resultMap.values());



                if (!data || data.length < 1) { data = [] }
                else {
                    data.map((item) => {
                        if (item.img) {
                            item.img = new Buffer(item.img, 'base64').toString('binary');
                            return item;
                        }
                    })
                }


                resolve({
                    errMessage: 'ok',
                    errCode: 0,
                    data
                })
            }
        } catch (e) {
            reject(e);
        }
    })
}

let getAllTopGame18 = (limit) => {
    return new Promise(async (resolve, reject) => {
        try {
            if (!limit) {
                resolve({
                    errCode: 1,
                    errMessage: 'Missing parameter'
                })
            }
            else {

                let orderByType = ['updatedAt', 'DESC'];


                const gamesWithC3Tag = await db.Game.findAll({
                    attributes: ['id'],
                    include: [
                        {
                            model: db.TagGame,
                            where: { tagId: 'C3' },
                        },
                    ],
                    raw: true,
                    nest: true,
                });

                const gameIds = gamesWithC3Tag.map(game => game.id);

                const fake = await db.Game.findAll({
                    include: [
                        {
                            model: db.TagGame,
                            where: { gameId: gameIds },
                            include: [
                                { model: db.AllCode }
                            ]

                        },
                    ],
                    order: [
                        orderByType,
                    ],

                    raw: true,
                    nest: true,
                });

                // let a = [
                //     {
                //         id: 3,
                //         name: 'abc',
                //         img: 'aaaa',
                //         TagGames: { tagId: 'C3', gameId: 1, AllCode: {} },
                //     },
                //     {
                //         id: 3,
                //         name: 'abc',
                //         img: 'aaaa',
                //         TagGames: { tagId: 'C2', gameId: 1, AllCode: {} },
                //     },
                //     {
                //         id: 9,
                //         name: 'abfsdc',
                //         img: 'fdsfs',
                //         TagGames: { tagId: 'C3', gameId: 2, AllCode: {} },
                //     },
                // ];

                let resultMap = new Map();

                fake.forEach(item => {
                    const id = item.id;

                    if (!resultMap.has(id)) {
                        resultMap.set(id, {
                            id: item.id,
                            name: item.name,
                            img: item.img,
                            url: item.url,
                            contentMarkdown: item.contentMarkdown,
                            contentHTML: item.contentHTML,
                            capacity: item.capacity,
                            partNumber: item.partNumber,
                            ram: item.ram,
                            playerNumber: item.playerNumber,
                            language: item.language,
                            win: item.win,
                            playWith: item.playWith,
                            seri: item.seri,
                            point: item.point,
                            createdAt: item.createdAt,
                            updatedAt: item.updatedAt,
                            TagGames: [item.TagGames],
                        });
                    } else {
                        resultMap.get(id).TagGames.push(item.TagGames);
                    }
                });

                let data = Array.from(resultMap.values());

                if (data && data.length > 0) {

                    if (!data || data.length < 1) { data = [] }
                    else {
                        data.map((item) => {
                            if (item.img) {
                                item.img = new Buffer(item.img, 'base64').toString('binary');
                                return item;
                            }
                        })
                    }

                    resolve({
                        errMessage: 'ok',
                        errCode: 0,
                        data
                    })

                }

            }
        } catch (e) {
            reject(e);
        }
    })
}

let getGameByCategory = (tagId, limit, pageNumber) => {
    return new Promise(async (resolve, reject) => {
        try {
            if (!limit) {
                resolve({
                    errCode: 1,
                    errMessage: 'Missing parameter'
                })
            }
            else {

                let orderByType = ['updatedAt', 'DESC'];
                const offset = (pageNumber - 1) * limit;


                const gamesWithC3Tag = await db.Game.findAll({
                    attributes: ['id'],
                    include: [
                        {
                            model: db.TagGame,
                            where: { tagId: tagId },
                        },
                    ],
                    order: [
                        orderByType,
                    ],
                    raw: true,
                    nest: true,
                });

                const gameIds = gamesWithC3Tag.map(game => game.id);



                let data = [];

                if (gameIds.length > 0) {

                    const fake = await db.Game.findAll({
                        include: [
                            {
                                model: db.TagGame,
                                where: { gameId: gameIds },
                                include: [
                                    { model: db.AllCode }
                                ]

                            },
                        ],
                        order: [
                            orderByType,
                        ],
                        limit: +limit,
                        offset: offset,

                        raw: true,
                        nest: true,
                    });


                    let resultMap = new Map();

                    fake.forEach(item => {
                        const id = item.id;

                        if (!resultMap.has(id)) {
                            resultMap.set(id, {
                                id: item.id,
                                name: item.name,
                                img: item.img,
                                url: item.url,
                                contentMarkdown: item.contentMarkdown,
                                contentHTML: item.contentHTML,
                                capacity: item.capacity,
                                partNumber: item.partNumber,
                                ram: item.ram,
                                playerNumber: item.playerNumber,
                                language: item.language,
                                win: item.win,
                                playWith: item.playWith,
                                seri: item.seri,
                                point: item.point,
                                createdAt: item.createdAt,
                                updatedAt: item.updatedAt,
                                TagGames: [item.TagGames],
                            });
                        } else {
                            resultMap.get(id).TagGames.push(item.TagGames);
                        }
                    });

                    data = Array.from(resultMap.values());
                }

                if (data && data.length > 0) {

                    if (!data || data.length < 1) {
                        data = []
                    }
                    else {
                        data.map((item) => {
                            if (item.img) {
                                item.img = new Buffer(item.img, 'base64').toString('binary');
                                return item;
                            }
                        })
                    }
                }

                resolve({
                    errMessage: 'ok',
                    errCode: 0,
                    allDataNumber: gameIds.length,
                    data
                })

            }
        } catch (e) {
            reject(e);
        }
    })
}

let getAllAccount = (limit, pageNumber) => {
    return new Promise(async (resolve, reject) => {
        try {
            if (!limit || !pageNumber) {
                resolve({
                    errCode: 1,
                    errMessage: 'Missing parameter'
                })
            }
            else {

                let orderByType = ['updatedAt', 'DESC'];
                const offset = (pageNumber - 1) * limit;


                let getLength = await db.User.findAll({
                    attributes: ['id']
                })

                let data = await db.User.findAll({
                    include: [
                        { model: db.AllCode }
                    ],
                    order: [['id', 'DESC']],
                    limit: +limit,
                    offset: offset,
                    raw: true,
                    nest: true,
                })


                if (!data) { data = [] }

                resolve({
                    errMessage: 'ok',
                    errCode: 0,
                    allDataNumber: getLength.length,
                    data
                })

            }
        } catch (e) {
            reject(e);
        }
    })
}

let getAllGame = (limit, pageNumber) => {
    return new Promise(async (resolve, reject) => {
        try {
            if (!limit || !pageNumber) {
                resolve({
                    errCode: 1,
                    errMessage: 'Missing parameter'
                })
            }
            else {
                const offset = (pageNumber - 1) * limit;


                let getLength = await db.Game.findAll({
                    attributes: ['id']
                })

                let data = await db.Game.findAll({
                    attributes: ['id', 'name', 'seri', 'point', 'createdAt', 'updatedAt'],
                    order: [['id', 'DESC']],
                    limit: +limit,
                    offset: offset,
                    raw: true,
                    nest: true,
                })


                if (!data || data.length < 0) { data = [] }
                else {
                    data.map((item) => {
                        if (item.img) {
                            item.img = new Buffer(item.img, 'base64').toString('binary');
                            return item;
                        }
                    })
                }

                resolve({
                    errMessage: 'ok',
                    errCode: 0,
                    allDataNumber: getLength.length,
                    data
                })

            }
        } catch (e) {
            reject(e);
        }
    })
}


let getGameById = (id) => {
    return new Promise(async (resolve, reject) => {
        try {
            if (!id) {
                resolve({
                    errCode: 1,
                    errMessage: 'Missing parameter'
                })
            }
            else {
                let data = await db.Game.findOne({
                    where: { id: id },
                    include: [
                        {
                            model: db.AllCode, as: 'languageData'
                        },
                        {
                            model: db.AllCode, as: 'winData'
                        },
                        {
                            model: db.AllCode, as: 'playWithData'
                        }

                    ],
                    raw: true,
                    nest: true
                })


                if (!data) { data = {} }
                else {
                    let dataFake = await getTagGameByGameId(data.id)
                    if (dataFake && dataFake.data && dataFake.data.length > 0) {
                        data.TagGames = [];
                        data.TagGames = dataFake.data
                    }

                    data.img = new Buffer(data.img, 'base64').toString('binary');
                }

                resolve({
                    errMessage: 'ok',
                    errCode: 0,
                    data
                })
            }
        } catch (e) {
            reject(e);

        }
    })
}

