let findGameByKeyWord = (keyWord) => {
    return new Promise(async (resolve, reject) => {
        try {
            if (!keyWord) {
                resolve({
                    errCode: 1,
                    errMessage: 'Missing required parameters'
                });
            }
            else {
                let data = await db.Game.findAll({
                    attributes: ['id', 'name', 'img'],
                    where: {
                        name: { [Op.like]: `%${keyWord}%` }
                    },
                    order: ['point'],
